import React from 'react';


const  App=()=>{
    function myFun(){
        return (
            `<h1 style={{color:"red"}} >You Clicked on me</h1>
             console.log("You Cliked on me") `
        )
    }
    return(
        <div>
        <button onClick={myFun}>Click me</button>
        </div>
    )

}
export default App;
